import React from 'react';
import profileImage from '../assets/LawDP.jpg';
const Home = () => {
  return (
    <div className="p-4 lg:p-8 bg-gray-100 dark:bg-gray-900 min-h-screen flex flex-col lg:flex-row items-center lg:items-start">
      {/* Image Section */}

      <div className="w-full lg:w-1/3 flex justify-center lg:justify-start mb-8 lg:mb-0">
      <img
  src={profileImage}
  alt="Law Bind Pandey"
  className="rounded-full w-48 h-48 lg:w-64 lg:h-64 object-cover shadow-lg"
/>
      </div>

      {/* Text Section */}
      <div className="w-full lg:w-2/3 lg:pl-8">
        <h1 className="text-2xl md:text-4xl font-bold text-gray-800 dark:text-white mb-4">
          Welcome to My Portfolio
        </h1>
        <p className="text-lg md:text-xl text-gray-600 dark:text-gray-300 mb-4">
          I am <span className="font-semibold">Law Bind Pandey</span>, a mathematics enthusiast with a good understanding of AI/ML and a research-oriented mindset. With 2 years of experience as a software developer in .NET, I aspire to become a machine learning engineer. I also have a strong foundation in Data Structures and Algorithms (DSA).
        </p>
        <p className="text-lg md:text-xl text-gray-600 dark:text-gray-300">
          Let's Connect!
        </p>
      </div>
    </div>
  );
};

export default Home;
